import styled from "styled-components";
import PropsBox from "./Components/Props/PropsBox1";
import ReduxBox from "./Components/Redux/ReduxBox";

const BackDiv = styled.div`
  display:flex;
  align-items:center;
  justify-content:center;
  height:100vh;
`

const StartPropsBox = styled.div`
    display: flex;
    align-items:center;
    justify-content:center;
    width:40%;
    height: 90%;
    border:solid 2px black;
    margin:5px;
`

const StartReduxBox = styled.div`
    display: flex;
    align-items:center;
    justify-content:center;
    width:40%;
    height: 90%;
    border:solid 2px black;
    margin:5px;
`

function App() {

  const plus = (e) => {
    console.log(e.target.value)
  }

  return (
    <BackDiv>
      <StartPropsBox />
      <StartReduxBox />
      <button onClick={plus}>+</button>
      <button>-</button>
    </BackDiv>
  );
}

export default App;
